import React from 'react'
import axios from 'axios'

export default function Guests(props) {

    const deleteGuest=()=> {
        axios.delete(`/deleteGuest/${props.id}`)
        .then(res=>{
            console.log("Success! "+props.name+" Deleted!")
        })
    }

    return (
        <div>
            <hr/>
        <div style={{display:"flex", flexDirection: "row"}}>
            <h3>{props.name}</h3>
            <h4 style={{alignSelf: "flex-end"}}>{props.attending ? "Going" : "Not Going"}</h4>
            <button onClick={deleteGuest()}>Delete</button>
        </div>
            <hr/>
        </div>
    )
}
